import React from 'react';
import './LoginNull.css';


class LoginNull extends React.Component {
  render() {
    return (
      <div className="popup">
        <div className="popup-inner">
          <div className="popup-content">
            <h2>Please Fill In the Login Field</h2>
            <p>You must enter your login to proceed.</p>
            {this.props.children}
            <button className="close-button" onClick={this.props.onClose}>Fechar</button>
          </div>
        </div>
      </div>
    );
  }
}

export default LoginNull;
